package com.app.secret.entity;import com.app.secret.core.base.entity.BaseEntity;import com.app.secret.core.util.TokenUtil;public class AppUserRole extends BaseEntity{			private java.lang.String uuid;   	private java.lang.String roleId;   	private java.lang.String userId;	public AppUserRole() {	}	public AppUserRole(String userId, String roleId) {		this.uuid = TokenUtil.genUUID();		this.userId = userId;		this.roleId = roleId;	}	public java.lang.String getUuid() {	    return this.uuid;	}	public void setUuid(java.lang.String uuid) {	    this.uuid=uuid;	}	public java.lang.String getRoleId() {	    return this.roleId;	}	public void setRoleId(java.lang.String roleId) {	    this.roleId=roleId;	}	public java.lang.String getUserId() {	    return this.userId;	}	public void setUserId(java.lang.String userId) {	    this.userId=userId;	}}